import React, {useState,useEffect, useContext} from 'react';
import './Profile.css';
import '../../AuthContext';
import AuthContext from '../../AuthContext';

const handleChange = (event) => {
    const file = event.target.files[0];
    if (file) {
        const reader = new FileReader();
        reader.onload = function(e) {
            const profileImage = document.getElementById('profileImage');
            profileImage.src = e.target.result; 
        };
        reader.readAsDataURL(file); 
    };
  };

const Profile = () => {
    const authContext = useContext(AuthContext);
    alert(authContext);
    // const [students, setStudents] = useState([]);

    // useEffect(()=>{
    //     // console.log("Loading Data ...")
    //     document.getElementById('imageUpload').addEventListener("change", handleChange, false);
    //     fetch(`http://localhost:8081/students/${authContext}`)
    //         .then(response=>response.json())
    //         .then(data=>setStudents(data))
    // },)

    return (
        // <div>
        //     <main>
        //         <h1>All Students</h1>
        //         <table id="studentsTable">
        //             <thead>
        //                 <tr>
        //                     <th>Name</th>
        //                     <th>Score</th>
        //                 </tr>
        //             </thead>
        //             <tbody>
        //                 {
        //                     students.map((student)=>{
        //                         return <Student key={student.id} name={student.name} score={student.score}/>
        //                     })
        //                 }
        //             </tbody>
        //         </table>
        //     </main>
        // </div>

        <div class="container">
        <div class="profile-container">
            <div class="profile-card">
                <div class="profile-image-container">
                    <img src="profile-pic.jpg" alt="Profile Picture" id="profileImage" class="profile-image"/>
                    <input type="file" id="imageUpload" accept="image/*" style="display: none;"/>
                    <button class="upload-button" onclick="document.getElementById('imageUpload').click();">Change Photo</button>
                </div>
                <h1 class="profile-name">Mr. John Doe</h1>

                <div class="profile-stats">
                    <div class="stat">
                        <h2 class="stat-number">350</h2>
                        <p class="stat-label">Followers</p>
                    </div>
                    <div class="stat">
                        <h2 class="stat-number">280</h2>
                        <p class="stat-label">Following</p>
                    </div>
                    <div>
                        <h2 class="stat-number">10</h2>
                        <p class="stat-label">Questions</p>
                    </div>
                </div>
            </div>
        </div>
            <div class="table-container">
                <h2>Questions Designed</h2>
                <table class="questions-table">
                    <thead>
                        <tr>
                            <th>Question</th>
                            <th>Hardness</th>
                            <th>Solved</th>
                            <th>Label</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td><a href="#">Sub</a></td>
                            <td>Easy</td>
                            <td><a href="#">245</a></td>
                            <td><a href="#">Math</a></td>
                        </tr>
                        <tr>
                            <td><a href="#">N-Queen</a></td>
                            <td>Hard</td>
                            <td><a href="#">80</a></td>
                            <td><a href="#">CS</a></td>
                        </tr>
                        <tr>
                            <td><a href="problem.html">+</a></td>
                            <td>...</td>
                            <td><a href="#"></a>...</td>
                            <td><a href="#"></a>...</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        </div>
    );
}

export default Profile;
